namespace Minesharp;

public sealed class Material : IEquatable<Material>
{
	private static readonly Dictionary<int, Material> ById = new();
	private static readonly Dictionary<string, Material> ByName = new();

    public bool Equals(Material other)
    {
        if (ReferenceEquals(null, other))
        {
            return false;
        }

        if (ReferenceEquals(this, other))
        {
            return true;
        }

        return Id == other.Id;
    }

    public override bool Equals(object obj)
    {
        return ReferenceEquals(this, obj) || obj is Material other && Equals(other);
    }

    public override int GetHashCode()
    {
        return Id;
    }

    public static bool operator ==(Material left, Material right)
    {
        return Equals(left, right);
    }

    public static bool operator !=(Material left, Material right)
    {
        return !Equals(left, right);
    }

