		Id = id;
		Name = name;

		ById[id] = this;
		ByName[name] = this;
	}

	public static Material GetMaterial(string name)
	{
		return ByName.GetValueOrDefault(name);
	}

	public static Material GetMaterial(int id)
	{
		return ById.GetValueOrDefault(id);
	}
}
